package db.domain;import java.util.Arrays;public class UserPracticeRequestImpl implements UserPracticeRequest {	@Key	private String applicant;	@Key	private String receiver;	private long requestTime;	private int roomType;	public UserPracticeRequestImpl() {	}	public UserPracticeRequestImpl(UserPracticeRequest c) {		this.applicant = c.getApplicant();		this.receiver = c.getReceiver();		this.requestTime = c.getRequestTime();		this.roomType = c.getRoomType();	}	@Override	public String tableName() {		return "user_practice_request";	}	public void setApplicant(String applicant) {		this.applicant = applicant;	}	public String getApplicant() {		return this.applicant;	}public void addApplicant(String applicant) {		this.applicant += applicant;}	public void setReceiver(String receiver) {		this.receiver = receiver;	}	public String getReceiver() {		return this.receiver;	}public void addReceiver(String receiver) {		this.receiver += receiver;}	public void setRequestTime(long requestTime) {		this.requestTime = requestTime;	}	public long getRequestTime() {		return this.requestTime;	}public void addRequestTime(long requestTime) {		this.requestTime += requestTime;}	public void setRoomType(int roomType) {		this.roomType = roomType;	}	public int getRoomType() {		return this.roomType;	}public void addRoomType(int roomType) {		this.roomType += roomType;}}